import Foundation
import SwiftUI


enum PreviewImages {
  static func imageFromBase64String(_ base64String: String) -> UIImage? {
    guard let imageData = Data(base64Encoded: base64String) else {
      return nil
    }
    return UIImage(data: imageData)
  }
  
  static let sampleImageBase64 = ""
}
